ls to trick people into providing personal and financial information.</span ></p >\n</td >\n</tr >\n<tr style=\"vertical-align:top\"  >\n<td style=\"width:12px;height:24px; padding-left:4px;padding-right:4px;padding-bottom:0px;padding-top:0px;vertical-align:top;\" >\n<p  legLH=\"1.094\" style=\"margin-left:0px;text-indent:0px;line-height:0.750;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span style=\"text-indent:0px\" id=\"embeded_image1978\"></span></p >\n</td >\n<td style=\"width:834px;height:24px; padding-left:4px;padding-right:4px;padding-bottom:0px;padding-top:0px;vertical-align:top;\" >\n<p  legLH=\"1.127\" style=\"margin-left:0px;text-indent:0px;line-height:1.080;margin-top:0px;margin-bottom:3px;text-align:left;\" >\n<span class=\"text1967Font1\"  >Impersonating a co-worker in an email and tricking people into wiring money.</span ></p >\n</td >\n</tr >\n<tr style=\"vertical-align:top\"  >\n<td style=\"width:12px;height:24px; padding-left:4px;padding-right:4px;padding-bottom:0px;padding-top:0px;vertical-align:top;\" >\n<p  legLH=\"1.094\" style=\"margin-left:0px;text-indent:0px;line-height:0.750;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span style=\"text-indent:0px\" id=\"embeded_image1979\"></span></p >\n</td >\n<td style=\"width:834px;height:24px; padding-left:4px;padding-right:4px;padding-bottom:0px;padding-top:0px;vertical-align:top;\" >\n<p  legLH=\"1.127\" style=\"margin-left:0px;text-indent:0px;line-height:1.080;margin-top:0px;margin-bottom:3px;text-align:left;\" >\n<span class=\"text1967Font1\"  >Impersonating a computer technician over the telephone to clean or repair your computer for a fee.</span ></p >\n</td >\n</tr >\n</table >\n</div>\n');
